      img_arr: [
        'https://i.etsystatic.com/19054927/d/il/a3d94e/1722862604/il_340x270.1722862604_1x55.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/a34e87/1770316883/il_340x270.1770316883_qre6.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/8f87cc/1769326265/il_340x270.1769326265_6573.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/de0dc4/1961173919/il_340x270.1961173919_jv63.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/c55a92/1718548256/il_340x270.1718548256_r86d.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/b89f27/1765996471/il_340x270.1765996471_7x8n.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/dddc0d/1941779572/il_340x270.1941779572_s1ac.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/d0c569/1941773438/il_340x270.1941773438_2pwy.jpg?version=0',
        'https://i.etsystatic.com/19054927/d/il/3acb4d/1961176383/il_340x270.1961176383_2r3y.jpg?version=0'
      ]
    };
  }


  render(){
    const {
      state: {
        img_arr
      }
    } = this;

    return (
      <div>

        <div>{img_arr.map((clothing) => {
          return (
            <Clothing
            /*placeholder arguments*/
            imgSource={clothing}
            buyLink={'https://www.etsy.com/ca/shop/NYBclothing'}
            price={'10$'}
            category={'t-shirt'}
            />
          );
        })}
        </div>

      </div>
    );
  }

}

export default Product;
